export default function AddSpot({features})
{
  
    return(
        <div className="add-spot">
             <input className="spot-input" placeholder="Name" type="text" />
             <input className="spot-input" placeholder="Country" type="text" />
             <input className="spot-input" placeholder="Latitude" type="text" />
             <input className="spot-input" placeholder="Longitude" type="text" />
             <input className="spot-input" placeholder="Wind Probability" type="text" />
             <button className='spot-button'>CONFIRM</button>
        </div>
    )
}
